//CSS
import './PostCard.css'

export default function PostCard({ nome, uf, cidade, referencia, descricao }) {
    return (
        <section className="post-card">
            <h1>{nome} - {cidade}/{uf}</h1>
            {referencia ? <h1>{referencia}</h1> : ''}
            <p>{descricao}</p>
        </section>
    )
}
